import React from 'react'
import { useSelector } from 'react-redux'

function MobileTech() {
    const mobileTech = useSelector(state => state.menuBar.mobile_tech)
    const colorOfBody = useSelector(state => state.menuBar.colorOfBody)

  return (
    <article key={mobileTech.id} className='articleTypeTech articleTypeTech-2'>
        {mobileTech.h2 && <h2>{mobileTech.h2}</h2>}
        {mobileTech.TechType.map(({ h3_kind, typeofKind }) => (
        <div key={h3_kind}>
            {h3_kind && <h3>{h3_kind}</h3>}
            <div className='itemList'>
            {typeofKind.map(({ id, src, p }) => (
                <div key={id} className={colorOfBody === 'light-theme' ? 'blockItem' : 'blockItem_1'}>
                    <img src={src} alt={p} />
                    <p>{p}</p>
                </div>
            ))}
            </div>
        </div>
        ))}
    </article> 
  )
}

export default MobileTech
